import React, { useState } from 'react';
import { Search, Clock, MapPin, ArrowLeft } from 'lucide-react';
import { useNavigate } from 'react-router-dom';

const Events = ({ allEvents, theme, searchTerm, setSearchTerm, onRegister }) => {
  const isDark = theme === 'dark';
  const navigate = useNavigate();
  const [activeTab, setActiveTab] = useState('All');

  const categories = ['All', 'Tech', 'Cultural', 'Sports'];

  // Filter logic for both Search and Category Tabs
  const filteredEvents = allEvents.filter(event => {
    const matchesSearch = event.title.toLowerCase().includes(searchTerm.toLowerCase());
    const matchesTab = activeTab === 'All' || event.category === activeTab;
    return matchesSearch && matchesTab;
  });

  const styles = {
    container: { padding: '16px', paddingBottom: '100px', minHeight: '100vh' },
    header: { display: 'flex', alignItems: 'center', gap: '15px', marginBottom: '20px' },
    searchBar: {
      display: 'flex',
      alignItems: 'center',
      gap: '10px',
      backgroundColor: isDark ? '#1e293b' : '#f1f5f9',
      padding: '12px 16px',
      borderRadius: '12px',
      marginBottom: '20px'
    },
    tabContainer: { display: 'flex', gap: '10px', marginBottom: '24px', overflowX: 'auto', paddingBottom: '5px' },
    tab: (active) => ({
      padding: '8px 20px',
      borderRadius: '10px',
      backgroundColor: active ? '#5c5cfc' : (isDark ? '#1e293b' : '#f1f5f9'),
      color: active ? '#fff' : (isDark ? '#94a3b8' : '#64748b'),
      border: 'none',
      fontWeight: 'bold',
      cursor: 'pointer'
    }),
    eventCard: {
      backgroundColor: isDark ? '#1e293b' : '#fff',
      borderRadius: '24px',
      overflow: 'hidden',
      marginBottom: '20px',
      border: isDark ? '1px solid #334155' : '1px solid #f1f5f9'
    },
    regBtn: (registered) => ({
      width: '100%',
      backgroundColor: registered ? '#16a34a' : '#5c5cfc',
      color: '#fff',
      border: 'none',
      padding: '12px',
      borderRadius: '12px',
      fontWeight: 'bold',
      marginTop: '16px',
      cursor: registered ? 'default' : 'pointer'
    })
  };

  return (
    <div style={styles.container}>
      <header style={styles.header}>
        <ArrowLeft size={24} onClick={() => navigate(-1)} style={{ cursor: 'pointer' }} />
        <h2 style={{ fontSize: '24px', fontWeight: 'bold' }}>Events</h2>
      </header>

      <div style={styles.searchBar}>
        <Search size={20} color="#94a3b8" />
        <input 
          placeholder="Search events..."
          value={searchTerm}
          onChange={(e) => setSearchTerm(e.target.value)}
          style={{ flex: 1, border: 'none', background: 'transparent', outline: 'none', color: isDark ? '#fff' : '#000' }}
        />
      </div>

      <div style={styles.tabContainer} className="hide-scrollbar">
        {categories.map(tab => (
          <button 
            key={tab} 
            onClick={() => setActiveTab(tab)}
            style={styles.tab(activeTab === tab)}
          >
            {tab}
          </button>
        ))}
      </div>

      {filteredEvents.map(event => (
        <div key={event.id} style={styles.eventCard}>
          <img src={event.image} alt={event.title} style={{ width: '100%', height: '180px', objectFit: 'cover' }} />
          <div style={{ padding: '16px' }}>
            <h4 style={{ fontSize: '18px', fontWeight: 'bold', margin: '0 0 10px 0' }}>{event.title}</h4>
            <div style={{ display: 'flex', alignItems: 'center', gap: '8px', fontSize: '13px', color: '#94a3b8' }}>
              <Clock size={16} /> {event.date}
            </div>
            <div style={{ display: 'flex', alignItems: 'center', gap: '8px', fontSize: '13px', color: '#94a3b8', marginTop: '6px' }}>
              <MapPin size={16} /> {event.location}
            </div>
            
            <button 
              style={styles.regBtn(event.isRegistered)}
              onClick={() => !event.isRegistered && onRegister(event.id)}
            >
              {event.isRegistered ? "✓ Registered" : "Register"}
            </button>
          </div>
        </div>
      ))}
    </div>
  );
};

export default Events;
